import{_ as e,c as a,o as t,a1 as r}from"./chunks/framework.D_xGnxpE.js";const _=JSON.parse('{"title":"COCONUT online - Data analysis","description":"","frontmatter":{},"headers":[],"relativePath":"analysis.md","filePath":"analysis.md"}'),n={name:"analysis.md"},s=r('<h1 id="coconut-online-data-analysis" tabindex="-1">COCONUT online - Data analysis <a class="header-anchor" href="#coconut-online-data-analysis" aria-label="Permalink to &quot;COCONUT online - Data analysis&quot;">​</a></h1><ul><li><p>As shown in the <a href="./sources.html">sources</a> section, COCONUT data has been extracted from 53 data sources and several have been manually collected from literature sets.</p></li><li><p>Currently, the COCONUT release (June 2023) contains 406,919 unique &quot;flat&quot; (without stereochemistry) NPs, and 730,441 NPs whose stereochemistry is preserved. Please refer to the original <a href="https://doi.org/10.1186/s13321-020-00478-9" target="_blank" rel="noreferrer">paper</a> for more details.</p></li><li><p>We extensively use the <a href="https://www.ebi.ac.uk/chembl/" target="_blank" rel="noreferrer">ChEMBL</a> <a href="https://jcheminf.biomedcentral.com/articles/10.1186/s13321-020-00456-1" target="_blank" rel="noreferrer">structure curation pipeline</a> developed with <a href="https://www.rdkit.org/" target="_blank" rel="noreferrer">RDKit</a> to clean the data and curate the database.</p></li></ul><h2 id="curation-steps" tabindex="-1">Curation steps <a class="header-anchor" href="#curation-steps" aria-label="Permalink to &quot;Curation steps&quot;">​</a></h2><ul><li>The snapshot of the mongoDB database form the COCONUT release 2022 was taken as the primary source, <ul><li>Polyfluorinated compounds (64 in total) were removed</li><li>Structures that cannot be parsed by the ChEMBL structure curation pipeline (113 in total) have been removed.</li><li>Duplicates have been merged into one entry and the highly annotated entry has been made the parent entry, and the remainder is now included in the parent entry.</li></ul></li></ul>',4),o=[s];function i(l,h,c,d,u,p){return t(),a("div",null,o)}const f=e(n,[["render",i]]);export{_ as __pageData,f as default};
